        <input type="submit" value="save"/>
      </form>
      <div className="gategories_list">
      <p>Категорії</p>
      <ul>
        <li>products</li>
        <li>service</li>
        <li>dress</li>
        <li>tel</li>
        <li>transport</li>
        <li>party</li>
      </ul>
      </div>
    </div>
  );
};

export default Categories;
